import React from 'react';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import LogoImage from '/Users/brianalexandre/Documents/GitHub/Brian-Develops/Spring/bdevelops/src/BrianLogo1.png';
function CollapsibleExample() {
  return (
    <Navbar collapseOnSelect expand="lg" className="nav">
      <Container>
        {/* Replace text with an image */}
        <Navbar.Brand href="#home">
          <img
            src={LogoImage}
            alt="Logo"
            //height="50"
            className="d-inline-block align-top"
          />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="me-auto">
          </Nav>
          <Nav>
          <Nav.Link href="#services" className="nav-link">Services</Nav.Link>
            <Nav.Link href="#projects" className="nav-link">Portfolio</Nav.Link>
            <Nav.Link href="#about" className="nav-link">About</Nav.Link>
            <Nav.Link eventKey={2} href="#contact" className="nav-link">
              Contact
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default CollapsibleExample;
